import Layout from "../components/MyLayout";
import Files from "../components/Files";

export default function Index() {
  return (
    <div>
      <img className="guc" src="/dumpTRUCKlogo.svg" />
      <Files />
      <Layout>
        <p>Home (/)</p>
      </Layout>
      <style jsx>{`
        .guc {
          height: 93%;
          width: 93%;
          margin: 0 auto;
        }
        .layout {
          margin: 20;
          padding: 20;
        }
      `}</style>
    </div>
  );
}
